import React from "react";
import Background from "../img/background.jpg";
import user from "../img/user.png";
import logo from "../img/entur_logo.jpg";

class Login extends React.Component {

    render() {
        return (
            <div>
                <img id="background" src={ Background } alt="" />
                <nav className="navBar">
                    <div className="padding">
                        <a href="/"><img src={logo} width={180} height={80} alt="Entur" /></a>
                    </div>
                </nav>
                <div className="register_box" id="small">
                    <form className="register" onSubmit={this.handleSubmit}>
                        <div className="message justify-content-center">
                            <img id='login-main' src={user} width={120} height={120} alt="Login" align="center" />
                            <br></br>
                            <br></br>
                            <input type="text" name="oppsummering" className="form-control" placeholder="Brukernavn" required/>
                            <input type="password" name="beskrivelse" className="form-control" placeholder="Passord" required/>
                        </div>
                        <br></br>
                        <button type="submit" className="btn btn-primary btn-md btn-block">Logg inn</button>}
                    </form>
                </div>
            </div>
        );
    }
}

export default Login;
